import React from 'react';

const PageTwo =(props) => {
    const data = props.data


    return (
    <div className={"note-list"}>
        {data.map((item,index) => (
            <div className={"note"} key={index}>
                <h1>{item.title} </h1>
                <p>{item.body}</p>
            </div>
        ))}


    </div>
    );


};
export default  PageTwo
